import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import GreetingsScreen from './screens/GreetingsScreen';
import MainUnauthScreen from './screens/MainUnauthScreen';
import AuthScreen from './screens/AuthScreen';
import RegScreen from './screens/RegScreen';
import ForgotScreen from './screens/ForgotScreen';
import HeaderLogoSvg from './assets/icons/headerLogoSvg';
import HeaderButton from './components/buttons/headerButton';

const Stack = createStackNavigator();

const screens = [
  {
    name: 'Greetings',
    component: GreetingsScreen,
    options: {
      headerLeft: () => <HeaderLogoSvg width={50} height={50} />,
      headerRight: () => <HeaderButton title="Button Text" onPress={() => console.log('Button Pressed')} />,
      headerShadowVisible: true,
      headerStyle: {
        borderBottomWidth: 1,
        borderBottomColor: '#ccc',
        backgroundColor: '#fff',
        elevation: 3
      },
    }
  },
  {
    name: 'MainUnauth',
    component: MainUnauthScreen,
    options: {
      title: 'Main Unauthenticated Screen',
    },
  },
  {
    name: 'Auth',
    component: AuthScreen,
    options: {
      title: 'Authentication Screen',
    },
  },
  {
    name: 'Reg',
    component: RegScreen,
    options: {
      title: 'Registration Screen',
    },
  },
  {
    name: 'Forgot',
    component: ForgotScreen,
    options: {
      title: 'Forgot Password Screen',
    },
  },
];

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Greetings">
        {screens.map((screen) => (
          <Stack.Screen key={screen.name} {...screen} />
        ))}
      </Stack.Navigator>
    </NavigationContainer>
  );
}
